tvgaControllers.controller('HomeCtrl', ['$scope', '$filter', 'cameraPhoto',
function($scope, $filter, cameraPhoto) {

    $scope.showHelp = false;
    $scope.dummyphoto = "";

    
    $scope.Init = function(){
        //alert(device.uuid); 
    };
    
    $scope.SetUpGA = function(){
        alert(device.uuid);
        ga('create', 'UA-76054-30', {
            'storage': 'none',
            'clientId':device.uuid
        });
        ga('send', 'pageview', {'page': '/index.html'});  
    };
    
    $scope.GetPicture = function(){
        if( navigator.camera ){
            navigator.camera.getPicture($scope.PhotoSuccess, $scope.PhotoFail, { 
                quality: 80,
                destinationType: 0,
        		correctOrientation: true,
    			encodingType: 0,
      			targetWidth: 1024,
      			targetHeight: 1024,
      			saveToPhotoAlbum: false
        	    });
        }else{
            $scope.PhotoSuccess($scope.dummyphoto);
        }
    };
    
    $scope.PhotoSuccess = function(imageData) {
        cameraPhoto.SetPhoto(imageData);
        myNavigator.pushPage('volumizer.html');
    };
    
    $scope.PhotoFail = function(message) {
        console.log('Failed because: ' + message);
        myNavigator.pushPage('volumizer.html');
    };
    
    $scope.Init();
    
}]);